import Thumbnail from "../assets/CFS_logo";

function Video() {

    return (
        <div className="Video">
            <img/>
            <div className="main">
                <div className="index">#1</div>
                <div className="download-button">
                    <i class="fa-solid fa-download"/>
                    <div className="download">Download</div>
                </div>
            </div>
            <div>From: 2024.04.03 13:22:54</div>
            <div>To: 2024.04.03 14:13:43</div>
        </div>
    );
}

export default Video;
